class Solution(object):
    def minimumOperationsToMakeEqual(self, x, y):
        """
        :type x: int
        :type y: int
        :rtype: int
        """
        from collections import deque
        queue = deque([(x, 0)])
        visited = set([x])

        while queue:
            current, steps = queue.popleft()
            if current == y:
                return steps

            operations = [current - 1, current + 1]
            if current % 5 == 0:
                operations.append(current // 5)
            if current % 11 == 0:
                operations.append(current // 11)

            for next_current in operations:
                if next_current >= 1 and next_current <= 104 and next_current not in visited:
                    visited.add(next_current)
                    queue.append((next_current, steps + 1))

        return -1
